import React, { useState, useEffect } from 'react';
import { TrendingUp, Trash2, Calendar, DollarSign, FileText } from 'lucide-react';
import api from '../services/api';

const Dashboard = () => {
  const [valuations, setValuations] = useState([]);
  const [loading, setLoading] = useState(true);
  const [stats, setStats] = useState({
    totalValuations: 0,
    latestValue: 0,
    averageValue: 0,
    growth: 0
  });

  useEffect(() => {
    loadValuations();
  }, []);

  const loadValuations = async () => {
    setLoading(true);
    try {
      const response = await api.get('/api/valuations/history');
      if (response.data && response.data.valuations) {
        const vals = response.data.valuations;
        setValuations(vals);

        // Calculate stats
        if (vals.length > 0) {
          const values = vals.map(v => v.estimated_value);
          const latest = values[0];
          const average = values.reduce((a, b) => a + b, 0) / values.length;

          // Calculate growth (latest vs oldest)
          let growth = 0;
          if (values.length > 1) {
            const oldest = values[values.length - 1];
            growth = ((latest - oldest) / oldest) * 100;
          }

          setStats({
            totalValuations: vals.length,
            latestValue: latest,
            averageValue: average,
            growth: growth
          });
        }
      }
    } catch (error) {
      console.error('Error loading valuations:', error);
    } finally {
      setLoading(false);
    }
  };

  const handleDelete = async (id) => {
    if (window.confirm('Are you sure you want to delete this valuation?')) {
      try {
        await api.delete(`/api/valuations/${id}`);
        loadValuations(); // Reload after delete
      } catch (error) {
        console.error('Error deleting valuation:', error);
        alert('Failed to delete valuation');
      }
    }
  };

  const formatDate = (dateString) => {
    const date = new Date(dateString);
    return date.toLocaleDateString('en-US', { 
      year: 'numeric', 
      month: 'short', 
      day: 'numeric' 
    });
  };

  if (loading) {
    return (
      <div className="flex justify-center items-center min-h-screen">
        <div className="animate-spin rounded-full h-12 w-12 border-b-2 border-blue-600"></div>
      </div>
    );
  }

  return (
    <div className="max-w-7xl mx-auto p-8">
      <div className="mb-8">
        <h1 className="text-3xl font-bold text-gray-900 mb-2">Dashboard</h1>
        <p className="text-gray-600">Track your business valuations over time</p>
      </div>

      {/* Stats Cards */}
      <div className="grid grid-cols-1 md:grid-cols-4 gap-6 mb-8">
        <div className="bg-white border rounded-lg p-6 shadow-sm">
          <div className="flex items-center justify-between mb-2">
            <h3 className="text-sm font-medium text-gray-600">Total Valuations</h3>
            <FileText className="text-blue-600" size={20} />
          </div>
          <p className="text-3xl font-bold text-gray-900">{stats.totalValuations}</p>
        </div>

        <div className="bg-white border rounded-lg p-6 shadow-sm">
          <div className="flex items-center justify-between mb-2">
            <h3 className="text-sm font-medium text-gray-600">Latest Value</h3>
            <DollarSign className="text-green-600" size={20} />
          </div>
          <p className="text-3xl font-bold text-gray-900">
            ${stats.latestValue.toLocaleString()}
          </p>
        </div>

        <div className="bg-white border rounded-lg p-6 shadow-sm">
          <div className="flex items-center justify-between mb-2">
            <h3 className="text-sm font-medium text-gray-600">Average Value</h3>
            <TrendingUp className="text-purple-600" size={20} />
          </div>
          <p className="text-3xl font-bold text-gray-900">
            ${stats.averageValue.toLocaleString()}
          </p>
        </div>

        <div className="bg-white border rounded-lg p-6 shadow-sm">
          <div className="flex items-center justify-between mb-2">
            <h3 className="text-sm font-medium text-gray-600">Growth</h3>
            <TrendingUp className={stats.growth >= 0 ? 'text-green-600' : 'text-red-600'} size={20} />
          </div>
          <p className={`text-3xl font-bold ${stats.growth >= 0 ? 'text-green-600' : 'text-red-600'}`}>
            {stats.growth >= 0 ? '+' : ''}{stats.growth.toFixed(1)}%
          </p>
        </div>
      </div>

      {/* Valuations Grid */}
      <div className="mb-4">
        <h2 className="text-xl font-bold text-gray-900 mb-4">Saved Valuations</h2>
      </div>

      {valuations.length === 0 ? (
        <div className="text-center py-16 bg-gray-50 rounded-lg border-2 border-dashed">
          <TrendingUp size={64} className="mx-auto text-gray-300 mb-4" />
          <h3 className="text-lg font-semibold text-gray-600 mb-2">No Valuations Yet</h3>
          <p className="text-gray-500 mb-6">Start by calculating a valuation</p>
          <a 
            href="/valuation" 
            className="inline-block px-6 py-3 bg-blue-600 text-white rounded-lg font-semibold hover:bg-blue-700"
          >
            Calculate Your First Valuation
          </a>
        </div>
      ) : (
        <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-6">
          {valuations.map(valuation => (
            <div 
              key={valuation.id} 
              className="bg-white border rounded-lg p-6 shadow-sm hover:shadow-md transition-shadow duration-200"
            >
              {/* Header */}
              <div className="flex justify-between items-start mb-4">
                <span className={`px-3 py-1 rounded-full text-xs font-bold ${
                  valuation.valuation_type === 'advanced'
                    ? 'bg-purple-100 text-purple-700'
                    : 'bg-blue-100 text-blue-700'
                }`}>
                  {valuation.valuation_type === 'advanced' ? 'ðŸŽ¯ Advanced' : 'âš¡ Quick'}
                </span>
                <button
                  onClick={() => handleDelete(valuation.id)}
                  className="text-gray-400 hover:text-red-600 transition-colors"
                  title="Delete valuation"
                >
                  <Trash2 size={18} />
                </button>
              </div>

              {/* Business Name */}
              <h3 className="font-bold text-lg text-gray-900 mb-3">
                {valuation.business_name}
              </h3>

              {/* Value */}
              <div className="mb-4">
                <p className="text-sm text-gray-500 mb-1">Estimated Value</p>
                <p className="text-3xl font-bold text-gray-900">
                  ${valuation.estimated_value?.toLocaleString()}
                </p>
              </div>

              {/* Method */}
              <div className="mb-4 pb-4 border-b">
                <p className="text-sm text-gray-500 mb-1">Method Used</p>
                <p className="text-sm font-medium text-gray-700">
                  {valuation.method_used}
                </p>
              </div>

              {/* Date */}
              <div className="flex items-center text-sm text-gray-500">
                <Calendar size={16} className="mr-2" />
                {formatDate(valuation.valuation_date)}
              </div>
            </div>
          ))}
        </div>
      )}

